import React from "react";

const App = () => {
  return (
    <div className="d-flex flex-column justify-content-center text-center">
      <h1>Bonjour inconnu</h1>
      <label htmlFor="nom">Your name?</label>
      <input
        type="text"
        name="nom"
        id="nom"
        placeholder="nom?"
        className="w-50"
      />
    </div>
  );
};

export default App;
